import React from 'react'
import Carditem from './Carditem'
import './Cards.css';
import iphone12pro from '../images/12pro.jpeg';
import iphone12 from '../images/12.jpeg';
import iphone11pro from '../images/11pro.jpg';
import iphone11 from '../images/11.jpeg';
import iphonese from '../images/se.jpeg';
import iphoneXR from '../images/xr.jpeg';
import ali from '../images/ali.jpeg';
import tyson from '../images/tyson.jpg';
import floyd from '../images/floyd.jpg';
import roy from '../images/roy.jpg';
import canelo from '../images/canelo.jpg';

function Cards() {
    return (
        <div className="cards">
            <div className="cards__container">
                <div className="cardss__wrapper">
                    <ul className="cards__items">
                        <Carditem
                            src={iphone12pro}
                            text="iPhone 12 pro"
                            label="1 159"
                            path="/"
                        />
                        <Carditem
                            src={iphone12}
                            text="iPhone 12"
                            label="50-6-2"
                            path="/"
                        />
                        <Carditem
                            src={iphone11pro}
                            text="iPhone 11 pro"
                            label="50-6-2"
                            path="/"
                        />
                    </ul>
                    <ul className="cards__items">
                        <Carditem
                            src={iphone11}
                            text="iPhone 11"
                            label="50-0-0"
                            path="/"
                        />
                        <Carditem
                            src={iphonese}
                            text="iPhone SE"
                            label="66-9-0"
                            path="/"
                        />
                        <Carditem
                            src={iphoneXR}
                            text="Saul Canelo Alvarez, world champion of WBC, WBA, WBO, IBF"
                            label="55-1-2"
                            path="/"
                        />
                    </ul>
                </div>
            </div>
        </div>
    )
}

export default Cards
